import React,{Component} from 'react';


class TopNavRight extends Component {
     
    render() {
        return (
            <div >
                <div className="col-lg-6 col-md-6 col-sm-12 col-xs-12">
                        <ul className="list-inline2">
                            <li>
                                <select id="basic" className="selectpicker show-tick form-control"
                                        placeholder="تسجيل الدخول" title="register">
                                        <option><a href="login.html" title="register" target="_blank">سجل هنا</a></option>
                                        <option><a href="register.html" title="register" target="_blank">الاشتراك</a>
                                        </option>
                                </select>
                                <i className="fas fa-users"></i>
                            </li>
                            <li><a href="tel:01028496209" title="Call me" target="_blank" class="mobile">01028496209<i
                                        className="fas fa-phone-alt"></i></a></li>
                            <li><a href="mailto:info@yourdomain.com" title="Mail" target="_blank">info@yourdomain.com<i
                                        className="far fa-envelope"></i></a></li>
                        </ul>
                    </div>
            </div>
        )
    };
}
export default TopNavRight;
